import React, { useState } from 'react';
import { Link } from 'react-scroll';
import styles from './styles.css';


const NavBar = () => {
    const [ showMenu, setShowMenu ] = useState(false);
    
    const handleMenuToggle = () => {
        setShowMenu(!showMenu);
        console.log(showMenu);
    };
    // TODO: Add links to navbar items and scroll them into view when clicked
    return (
        <nav className='navBar'>
            <div className="logo">Logo</div>
            <div className={`menu ${showMenu ? 'show' : ''}`}>
                <ul className='navBarUl'> 
                <li><Link
                        to='home'
                        smooth={true}
                        duration={500}
                        onClick={handleMenuToggle}
                    >
                        Home
                    </Link></li>
                    <li><Link
                        to='servicios'
                        smooth={true}
                        duration={500}
                        onClick={handleMenuToggle}
                    >
                        Servicios
                    </Link></li>
                    <li><Link
                        to='nosotros'
                        smooth={true}
                        duration={500}
                        onClick={handleMenuToggle}
                    >
                        Nosotros
                    </Link></li>
                    <li><Link
                        to='contacto'
                        smooth={true}
                        duration={500}
                        onClick={handleMenuToggle}
                    >
                        Contacto
                    </Link></li>
                </ul>
            </div>

            <div className={`hamburguer ${showMenu ? 'open' : ''}`} onClick={handleMenuToggle}>
                <div className="line"></div>
                <div className="line"></div>
                <div className="line"></div>
            </div>
            {/* <div className="hamburguer" onClick={handleMenuToggle}>
                <div className={`line ${showMenu ? 'open' : ''}`}/>
                <div className={`line ${showMenu ? 'open' : ''}`}/>
                <div className={`line ${showMenu ? 'open' : ''}`}/>
            </div> */}

        </nav>
    );
};

export default NavBar;
